import headshot from './headshot.jpg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={headshot} size="50"/>
        <p>
          Maja Schermuly's Website
        </p>

      </header>
    </div>
  );
}

export default App;
